#S. Lapointe, K. Zhang, M.J. McNenly,
#Reduced chemical model for low and high-temperature oxidation of fuel blends relevant to internal combustion engines,
#Proceedings of the Combustion Institute,
#Volume 37, Issue 1,
#2019,
#Pages 789-796,
#ISSN 1540-7489,
#https://doi.org/10.1016/j.proci.2018.06.139.
#(http://www.sciencedirect.com/science/article/pii/S1540748918303225)
#
#Abstract: A hybrid approach is proposed to develop reduced kinetic models for complex engine-relevant fuels. The reduced mechanism is composed of a core submechanism including C0â€“C4 chemistry, ethanol chemistry, and NOx chemistry and a fuel-dependent submechanism. The fuel-dependent submechanism consists of three species and ten reactions describing both the low and high-temperature fuel decomposition pathways. Calibrations for these reactions can be made for single component and multicomponent mixtures using experimental targets or results from detailed kinetic mechanisms. In the present study, the methodology is applied to the combustion of gasoline surrogates. Reduced mechanisms are calibrated for primary reference fuels and multicomponent mixtures at engine-relevant pressures. The reduced mechanisms capture the low-temperature heat release and negative temperature coefficient (NTC) behavior, which are important to simulations of internal combustion engine performance. The mechanisms are very compact in size and can be easily calibrated for multicomponent mixtures without any detailed knowledge of the chemistry of the fuel components, making them well suited for CFD simulations of new fuel blends.
#Keywords: Reduced chemical mechanism; PRF/toluene/ethanol; Gasoline surrogategenerator: ck2yaml
